import React from "react";

export default class Workspace extends React.Component {
    render() {
        const { list } = this.prop.currentList;
        let item1 = list[0];
        let item2 = list[1];
        let item3 = list[2];
        let item4 = list[3];
        let item5 = list[4];

        return (
            <div id="top5-workspace">
                <div id="workspace-edit">
                    <div id="edit-numbering">
                        <div className="item-number">1.{item1}</div>
                        <div className="item-number">2.{item2}</div>
                        <div className="item-number">3.{item3}</div>
                        <div className="item-number">4.{item4}</div>
                        <div className="item-number">5.{item5}</div>
                    </div>
                </div>
            </div>
        )
    }
}
